import React, { Component } from 'react';
import './App.css';
import {inject, observer} from 'mobx-react';
import Todo from "./component/todo.js";
import Add from "./component/add";

@inject('myTodoApp')
@observer

class App extends Component {
  constructor(props) {
    super(props);
    props.myTodoApp.getItems();
  }

  render() {
    const {myTodoApp} = this.props;

    const elements = myTodoApp.data.todos.results.map((item, key)=> 
      <Todo key={key} item={item} />
    )

    return (

      <div className="App">
        <header className="App-header">

          <h1>My House List</h1>

          <div className="get">
          <h2>Get</h2>

          <ul>
            {elements}
          </ul>
          </div>

          <div className="post">
          <h2>Post</h2>
          <Add
            addNewTodo = {myTodoApp.addNewTodo}
            wrongInput = {myTodoApp.wrongInput}
          />
          </div>

        </header>
      </div>
    );
  }
}

export default App;
